import React, {useState} from "react";

import Box from "@mui/material/Box"
import Tab from '@mui/material/Tab';
import Tabs from '@mui/material/Tabs';

import Table from '@mui/material/Table';
import TableHead from '@mui/material/TableHead';
import TableBody from '@mui/material/TableBody';
import TableRow from '@mui/material/TableRow';
import TableCell from '@mui/material/TableCell';

function Result_post(props)
{
    const [full_data, set_full_data] = useState(props.data.current);
    const [tab_value, set_tab_value] = useState(0);

    const [result_data, set_result_data] = useState(full_data.item[tab_value]);
    //console.log(full_data.date);

    let full_money = 0;
    for (const i of full_data.item)
    {
        full_money = full_money + i.money
    }

    let my_money = result_data.money;
    let my_need_money = 0;
    let my_per = 0;
    let my_needper = 0;

    function tab_change(e, value)
    {
        set_tab_value(value);
        set_result_data(full_data.item[value]);
    }


    return (
        <Box sx={{display: "flex", height: "100%", width: "100%", flexDirection: "column"}}>
            <Box sx={{borderBottom: 1, borderColor: 'divider',  width: "100%"}}>
                <Tabs value={tab_value} onChange={tab_change}>
                    {
                        full_data.item.map((element, index) => (
                            <Tab key={element.id} value={index} label={element.name}/>
                    ))
                    }
                    
                </Tabs>
                
                
            </Box>
            <Box>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell align="center">
                                
                            </TableCell>
                            <TableCell align="center">
                                money
                            </TableCell>
                            <TableCell align="center">
                                need_money
                            </TableCell>
                            <TableCell align="center">
                                per
                            </TableCell>
                            <TableCell align="center">
                                nee_per
                            </TableCell>
                        </TableRow>
                    </TableHead>
                </Table>
            </Box>
            <Box sx={{ overflowY: "scroll", flexGrow: 1}}>
                <Table>
                    <TableBody>
                        <TableRow>
                            <TableCell align="center">
                                {result_data.name}
                            </TableCell>
                            <TableCell align="center">
                                {my_money}
                            </TableCell>
                            <TableCell align="center">
                                need_money
                            </TableCell>
                            <TableCell align="center">
                                per
                            </TableCell>
                            <TableCell align="center">
                                nee_per
                            </TableCell>
                        </TableRow>

                    </TableBody>
                </Table>
            </Box>
            
        </Box>
    )
}

function Global_result(props)
{
    

}

function Stock_frame_result(props)
{
    const [full_data, set_full_data] = useState();
    let my_money = 0;
    let my_need_money = 0;
    let my_per = 0;
    let my_need_per = 0;

    my_money = full_data.money;
    my_per = my_money / props.full_money;
    my_need_per = full_data.wantper - my_per;
    my_need_money = props.full_money * (full_data.wantper / 100) - my_money;

    return (
        <>
        {
            full_data.item.map((element) => (
                <Stock_result key={element.id} full_money={my_money} ele={element}/>
            ))
        }
        </>
    )
}

function Stock_result(props)
{
    const [full_data, set_full_data] = useState(props.element);
    let my_money = 0;
    let my_need_money = 0;
    let my_per = 0;
    let my_need_per = 0;

    my_money = full_data.money;
    my_per = my_money / props.full_money;
    my_need_per = full_data.wantper - my_per;
    my_need_money = props.full_money * (full_data.wantper / 100) - my_money;
    return (
        <>
        </>
    )
}

export default Result_post;
